import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The HTML doesn't render the sort controls by default.
    // We need to trigger a search to make them appear.
    // 1. Fill the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'phone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // 2. Click the search button
    // Using a selector that finds the button next to the search input
    await page.click('input#searchInput + button.search-btn');

    // 3. Wait for the sort controls to be visible after the search
    await page.waitForSelector('#sortSelect', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Select the 'Price: High to Low' option from the dropdown
    const sortDropdownSelector = '#sortSelect';
    await page.selectOption(sortDropdownSelector, 'price-high');

    // 5. Take a screenshot after applying the sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sorted.png'));

    // 6. Extract the selected value to verify the action
    const selectedSortValue = await page.inputValue(sortDropdownSelector);

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter.",
      extractedData: {
        selectedSortOption: selectedSortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
